import React from 'react';
import PostCard from '../components/PostCard';

const Home = () => {
  return (
    <div className="container">
      <div className="posts">
        <PostCard title="記事1" imageUrl="https://via.placeholder.com/150" excerpt="記事の要約1" />
        <PostCard title="記事2" imageUrl="https://via.placeholder.com/150" excerpt="記事の要約2" />
        <PostCard title="記事3" imageUrl="https://via.placeholder.com/150" excerpt="記事の要約3" />
      </div>
    </div>
  );
};

export default Home;
